В двухместных комнатах квартирного типа предусмотрены:
1.	Место приготовления и приема пищи;
2.	Комплект мебели и мягкий инвентарь (кровать, шкаф, полка, тумба, стол, стулья);
3.	Холодильник, электрическая плита;
4.	Датчики пожарной безопасности;
5.	Звуковая система оповещения при ЧС;
6.	Совмещенный санузел (туалет и душ).

Общежитие РГГУ располагается в центре Москвы, недалеко от м. Новослободская. В здании общежития есть:
- общая оборудованная кухня и холодильник (на каждом этаже);
- система пожарной безопасности;
- круглосуточная охрана;
- система видеонаблюдения;
- бесплатный беспроводной интернет;
- мебель (кровать, стол, стул, шкаф);
- санузел (на этаже).

Спортивно-оздоровительный комплекс «Шарап» расположен в 90 км от Новосибирска на берегу Обского водохранилища в Ордынском районе.
Предлагаются услуги проживания, питания и занятий спортом:
    проживание в четырехместных домиках;
    3-разовое питание в столовой;
    спортивные площадки с резинобитумным покрытием для игры в волейбол, баскетбол, бадминтон;
    спортивные тренажеры;
    пирс, где к вашим услугам гребные лодки, катамараны, виндсерфинги.

1 сезон: 6—18 июля
2 сезон: 18—30 июля
3 сезон: 30 июля — 11 августа
4 сезон: 11—23 августа

